import React,{Component} from 'react';
import 'tachyons';
import AOS from 'aos';
import {Carousel} from 'react-bootstrap';
import image1 from '../.././testimonials/1.png';
import image2 from '../.././testimonials/2.png';
import image3 from '../.././testimonials/3.png';


const Test=()=>
{
return(
<div data-aos="zoom-in" data-aos-easing="ease-in-sine" data-aos-duration="1000">
  <h1>Our <span className="code mb6 mt4">testimonials</span>.</h1>
  <Carousel className="mt4" >

  <Carousel.Item className="pa5" >
    <img
      className="d-block w-100"
      src={image1}
      alt="First slide"
      className="test"
    />
    &nbsp;
    &nbsp;
    <h3 className="mt3">Tanmay Jagtap</h3>
    &nbsp;
    <p>We have been hands on various projects together and Abhishek is one of the best people I had as a patner,
    He has strong problem solving skills and his ability for tackling problems is remarkable! His dedication to work on
    various projects and desire to learn various technologies has always inspired me, as a team member
    Abhishek earns my highest recommendation.</p>
  <p className=" mb5">  5th January 2021</p>
  </Carousel.Item>


  <Carousel.Item className="pa5" >
    <img
      className="d-block w-100"
      src={image2}
      alt="Second slide"
      className="test"
    />
    &nbsp;
    <h3 className="mt3">Tejas Machkar</h3>
    &nbsp;
    <p>We have been hands on various projects together and Abhishek is one of the best people I had as a patner,
    He has strong problem solving skills and his ability for tackling problems is remarkable! His dedication to work on
    various projects and desire to learn various technologies has always inspired me, as a team member
    Abhishek earns my highest recommendation.</p>

    <p className=" mb5">5th January 2021</p>
  </Carousel.Item>

  <Carousel.Item className="pa5">
    <img
      className="d-block w-100"
      src={image3}
      alt="Third slide"
      className="test"
    />&nbsp;
    <h3 className="mt3">Rehan Shaikh</h3>
    &nbsp;
    <p>We have been hands on various projects together and Abhishek is one of the best people I had as a patner,
    He has strong problem solving skills and his ability for tackling problems is remarkable! His dedication to work on
     various projects and desire to learn various technologies has always inspired me, as a team member
     Abhishek earns my highest recommendation.</p>

  <p className=" mb5">  5th January 2021</p>

  </Carousel.Item>
</Carousel>
</div>
);
}
export default Test;
